function run(retornoApiRepositoriosResponse) {
	try {
		const retornoRepositorios = JSON.parse(retornoApiRepositoriosResponse);

		const sortedData = retornoRepositorios.sort(function (a, b) {
			return new Date(a.createdAt) - new Date(b.createdAt);
		});

		let variables = {};
		for (let i = 0; i < sortedData.length; i++) {
			const idx = i + 1;
			variables[`name${idx}`] = sortedData[i].name;
			variables[`description${idx}`] = sortedData[i].description;
			variables[`htmlUrl${idx}`] = sortedData[i].htmlUrl;
			variables[`createdAt${idx}`] = sortedData[i].createdAt;
			variables[`language${idx}`] = sortedData[i].language;
		}
		return variables;
	} catch (error) {
		console.error("Erro ao processar os dados:", error.message);
		return null;
	}
}

function run(retryAPI) {
    if (typeof retryAPI === "undefined" || retryAPI === null) {
        retryAPI = 0;
    }
    retryAPI += 1;
    return retryAPI;
}
